import React from "react";
import ReactDOM from "react-dom";
import "./Square.css";
import "./Board.css";
import "./BoardRow.css";

class Square extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return <div>{this.props.squareNum}</div>;
  }
}
class BoardRow extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <Square squareNum={this.props.num} />
        <Square squareNum={this.props.num + 1} />
        <Square squareNum={this.props.num + 2} />
      </div>
    );
  }
}

export class Board extends React.Component {
  render() {
    return (
      <div>
        <div>
          <BoardRow num={1} />
        </div>
        <div>
          <BoardRow num={4} />
        </div>
        <div>
          <BoardRow num={7} />
        </div>
      </div>
    );
  }
}
